import MenuItem from "./MenuItem";

const MenuList = ({ products, reff, ...props }) => {
  return (
    <div className="container">
      <div {...props} ref={reff} className="menuList">
        {products.map((item) => (
          <MenuItem key={item.id} product={item} />
        ))}
      </div>
    </div>
  );
};

export default MenuList;
